import CommentForm from './CommentForm';
import CommentList from './CommentList';

class MainVideoComments extends Component {

    render () {
        return (
            <>
                <CommentForm/>
                <CommentList
                    comments = {this.props.comments}
                />
            </>
        );
    }
}
export default MainVideoComments;
